import React from "react";
import "../App.css";
import { Tabs, TabList, TabPanels, Tab, TabPanel } from '@chakra-ui/react'


function HeaderBar() {
    return (
      <Tabs variant='unstyled'>
  <TabList>
    <Tab _hover={{ color: 'white', bg: 'blue.500' }}>Tab 1</Tab>
    <Tab _selecte={{ color: 'white', bg: 'green.400' }}>Tab 2</Tab>
  </TabList>
  <TabPanels>
    <TabPanel>
      <p>one!</p>
    </TabPanel>
    <TabPanel>
      <p>two!</p>
    </TabPanel>
  </TabPanels>
</Tabs>
    );
    }

export default HeaderBar;
